import React from 'react';
import { makeStyles, Card, CardActions, CardContent, Typography, CardActionArea} from '@material-ui/core';

const styles = makeStyles({
    root:{
        width: "240px",
        height: "20%"
    },


})

function UnitCard() {

    const UnitList = [
        {
            unit: 'math',
            topic: 'calculus',
            grade: 60
        },

        {
            unit: 'chem',
            topic: 'inorganic chem',
            grade: 60
        },

        {
            unit: 'bio',
            topic: 'cells',
            grade: 60
        },

        {
            unit: 'physics',
            topic: 'inertia',
            grade: 60
        },
    ]

    const classes = styles();

    return (
        <div>
            {UnitList.map(val => (
            <Card className={classes.root}>
                <CardActionArea>
                    <CardContent>
                        {val.unit}
                    </CardContent>
                </CardActionArea>
            </Card>
            ))}
        </div>
    )
}

export default UnitCard
